import React from "react";

const Loading = () => {
  return (
    <div className="App Loading">
      <div className="header">
        <img
          className="play-logo"
          src="/play-logo.png"
          alt="Play antropoloops"
        />
      </div>
      <div id="scroll" className="scroll" />
      <div className="footer">Footer</div>
      <div className="visuals" />
    </div>
  );
};

export default Loading;
